import React from "react";
import Video from "./Video";

function VideoList({ videos, onVote, onRemoveVideo }) {
  return (
    <div className="video-list">
      {videos.map((video) => (
        <Video
          key={video.id}
          video={video}
          onVote={onVote}
          onRemoveVideo={onRemoveVideo}
        />
      ))}
    </div>
  );
}

export default VideoList;
